import React from 'react';

const EmojiImage = ({ emojis }) => {
	return (
		<div>
			{emojis.map((row, index) => {
				return (
					<div key={'row' + index} style={{ margin: 0, padding: 0, height: '6px', width: '95%', margin: '0 auto' }}>
						{row.map((emoji, index) => {
							return (
								<span key={index} style={{ display: 'inline-block', margin: 0, padding: 0, fontSize: '6px', width: 100 / row.length + '%' }}>
									{emoji === 'empty' ? '\u00A0' : emoji}
								</span>
							);
						})}
					</div>
				);
			})}
		</div>
	);
};

export default EmojiImage;
